const Reducer = (state, action) => {
	switch (action.type) {
		case 'ALREADY LOGIN':			
			return {...state , isLogin : true}
		case 'ALREADY LOGOUT':
			return { ...state, isLogin: true }
		default:
			return state
	}
}
export default Reducer
